import React, { Component } from 'react';
import { Link, Route } from 'react-router-dom'

import './App.css';

import routesConfig from './routesConfig';

class App extends Component {

  render() {
    return (
      <div>
        <div style={{width: '100%', height: '20vh', display: 'flex', justifyContent: 'space-evenly', flexDirection: 'column', backgroundColor: '#4792FF'}}>
          <Link to="/" >Home</Link>
          <Link to="/user" >User</Link>
        </div>
        {routesConfig.map((value, key) => {
          return <Route
            key={key}
            path={value.path}
            component={value.component}
            exact={value.exact}
          />
        })}
      </div>
    );
  }
}

export default App;
